import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./ATSAnalysis.css";

const ATSAnalysis = () => {
  const navigate = useNavigate();
  const [resumeFile, setResumeFile] = useState(null);
  const [jobDescription, setJobDescription] = useState("");
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (
      file &&
      (file.type === "application/pdf" ||
        file.type ===
          "application/vnd.openxmlformats-officedocument.wordprocessingml.document")
    ) {
      setResumeFile(file);
    } else {
      alert("Please upload a PDF or DOCX file");
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!resumeFile || !jobDescription) {
      alert("Please upload a resume and provide a job description");
      return;
    }

    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('resume', resumeFile);
      formData.append('jobDescription', jobDescription);

      const response = await fetch('http://localhost:3001/api/analyze-resume', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error('Analysis failed');
      }

      const data = await response.json();
      setAnalysis(data);
    } catch (error) {
      console.error('Error analyzing resume:', error);
      alert('Error analyzing resume. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleBack = () => {
    navigate("/");
  };

  return (
    <div className="ats-container">
      <div className="ats-header">
        <button onClick={handleBack} className="back-button">
          <i className="fas fa-arrow-left"></i> Back
        </button>
        <h2>Resume ATS Analysis</h2>
      </div>

      <form onSubmit={handleSubmit} className="ats-form">
        <div className="upload-section">
          <label htmlFor="resume-upload" className="upload-label">
            <div className="upload-box">
              <i className="fas fa-cloud-upload-alt"></i>
              <p>Upload Resume (PDF/DOCX)</p>
              {resumeFile && <p className="file-name">{resumeFile.name}</p>}
            </div>
          </label>
          <input
            id="resume-upload"
            type="file"
            accept=".pdf,.docx"
            onChange={handleFileChange}
            className="file-input"
          />
        </div>

        <div className="job-description-section">
          <label htmlFor="job-description">Job Description</label>
          <textarea
            id="job-description"
            value={jobDescription}
            onChange={(e) => setJobDescription(e.target.value)}
            placeholder="Paste the job description here..."
            rows="6"
          />
        </div>

        <button type="submit" className="analyze-button" disabled={loading}>
          {loading ? "Analyzing..." : "Analyze Resume"}
        </button>
      </form>

      {analysis && (
        <div className="results-section">
          <div className="score-circle">
            <span className="score">{analysis.score}%</span>
            <span className="score-label">ATS Score</span>
          </div>
          <div className="feedback-list">
            <h3>Analysis Feedback</h3>
            <ul>
              {analysis.feedback.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default ATSAnalysis;
